import React from 'react';
import { Dropdown } from 'semantic-ui-react';

const schoolOptions = [
  { key: 'qc', text: "Queen's College", value: "Queen's College" },
  { key: 'ka', text: 'Kingsway Academy', value: 'Kingsway Academy' },
  { key: 'sac', text: 'St. Augustine College', value: 'St. Augustine College' },
  { key: 'ac', text: 'Aquinas College', value: 'Aquinas College' },
];

const SchoolList = () => (
  <div className="mx-auto max-w-xs">
    <Dropdown
      className="w-full"
      placeholder="Select a School"
      search
      selection
      options={schoolOptions}
    />
  </div>
);

export default SchoolList;
